import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';

function Post() {
  let { id } = useParams();
  useEffect(() => {
    axios.get('http://localhost:3001/posts').then((response) => {
      setListOfPosts(response.data);
    });
  });
  return <div>{id}</div>;
}

export default Post;
